;; gorilla-repl.fileformat = 1

;; **
;;; # OVERALL NETWORK
;;; In the following the complete network is studying by using a subset of measures explained in Section (ref). This worksheet compiles measures between 5 April 2015 and 15 April 2015 by computing statistics for hourly expansions, distributions over 30 days, as well as the average value at a time of day on the complete dataset. 
;; **

;; @@
(ns overall-network
  (:refer-clojure :exclude [find sort])
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.table :as table]
            [gg4clj.core :as gg4clj]
            [ceres-analytics.core :refer [t0 tmax]]
            [ceres-analytics.measures :refer [nw-size order total-degree density]]
            [ceres-analytics.cascade :as cs]
            [ceres-analytics.helpers :refer [element-color element-name contacts cascades nodes table-columns format-to-table-view]]
            [incanter.stats :as stats]
            [incanter.core :as incntr]))
;; @@
