;; **
;;; ## Daily Expansion 
;; **

;; @@
(let [result (total-degree contacts t0 tmax :daily)
       dat {:day (mapcat keys (vals result))
            :count (mapcat vals (vals result))
            :type (apply concat (map (fn [[k v]] (repeat (count v) (element-name k))) result))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count {:group :type :color :type}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Total degree"]
         [:theme_bw]
         [:ggtitle "Total degree daily evolution"])]
      {:width 7 :height 6}))
