;; **
;;; ## Time of day delta
;; **

;; @@
(let [result (density nodes contacts t0 tmax :time)
      dat {:time (keys result)
           :count (map :mean (vals result))
           :semax (map #(+ (:mean %) (:sd %)) (vals result))
           :semin (map #(- (:mean %) (:sd %)) (vals result))}
      ]
  (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :time :count]]
         [:geom_errorbar [:aes {:ymin :semin :ymax :semax }] {:width 0.68 :color "darkgrey"}]
         [:geom_line {:stat "identity" :color "steelblue"}]
         [:geom_point {:color "steelblue"}]
         [:xlab "Time of day"]
         [:ylab "Average Density"]
         [:theme_bw]
         [:ggtitle "Density time of day evolution"])]
      {:width 7 :height 6}))
